                hours = Convert.ToInt32(thours);
            }
            if (tminutes != "")
            {
                minutes = Convert.ToInt32(tminutes);
            }
            if (tseconds != "")
            {
                seconds = Convert.ToInt32(tseconds);
            }


            chosenTime = new TimeSpan(hours, minutes, seconds);
            on = !on;
            if (on)
                buttonText = MLIndex.stop;
            else
                buttonText = MLIndex.start;


            if (theTime == counting)
            {
                buttonText = MLIndex.start;
                counting = "";
                // if (s != null)
